import { useEffect } from "react"

function useStats() {
    const [stats, setStats] = useState();
    useEffect(() => {
        async function fetchData() {
            console.log('Fetching Data');
            fetch('https://covid19.mathdro.id/api').
            then(data => data.json());
        }
        fetchData();
    }, []);
}

export default function Index() {
    return <h1>Coronavirus</h1>
}
